    concept of a 'healthy population' of wildlife because is important to evaluating
    the management direction for the National Elk Refuge (NER) against the Refuge System
    Improvement Act. The NER is in need of a definition or concept of 'healthy populations'
    that is defensible, is established before there is more pressure to define it according
    to special interests, and does not conflict with the use of the term on other refuges.",nt"license_title":
